const HomePage = () => {
    return (

        <div
            className="min-h-screen bg-cover bg-center flex justify-center"
            style={{
                backgroundImage: "url('https://images.unsplash.com/photo-1451187580459-43490279c0fa?q=80&w=3872&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D')"
            }}
        >

            
        <div className="bg-blue bg-opacity-100 p-12 rounded-lg text-center h-10">
                <h1 className="text-5xl font-bold text-white mb-8">
                    Asset Eye
                </h1>
                <h3 className="text-xl font-medium text-white mb-4">Have an account? <a className="text-blue-400" href="/login">Login</a></h3>
                <h3 className="text-xl font-medium text-white mb-4">Need an account? <a className="text-blue-400" href="/register">Register</a></h3>
            </div>
        </div>

    )
}

export default HomePage
